    return (
      <div>
          { usuariosCadastrados.map((user) => {
            return {}
          })}
      </div>
    )
  }
}

const mapStateToProps = (state) => ({
  usuariosCadastrados: state.login.signUpUsers,
});

export default connect(mapStateToProps)(LoginEfetuado);
